import React, { useState } from 'react';
import { Link } from 'react-router-dom';
import dummyData from './static/dummyData';



function Sidebar() {
    const [data, setData] = useState(dummyData);

    return (
        <>
            {data.map((el) =>
             <p key={el.id}>
                <Link to="/{el.title}">{el.title}</Link>
            </p>
            )}
        </>
    )

}

export default Sidebar
